import React from 'react'
import "./Feed.css";

export default function Feed() {
  return (
    <div classname="container">
        <div className="about-feed">
            <div className="about-description">
                <h1>about description</h1>
            </div>
            <div className="about-img">
                <h1></h1>
            </div>
        </div>
    </div>
  )
}
